define({"topics" : [{"title":"Java Configuration Options for the Cli Command","shortdesc":"\n               <p class=\"shortdesc\">Use the SDC_CLI_JAVA_OPTS environment variable to modify Java configuration options for         the <code class=\"ph codeph\">cli</code> command.\n               </p>\n            ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_zrc_qch_xw","attributes": {"data-id":"concept_zrc_qch_xw",},"menu": {"hasChildren":false,},"tocID":"concept_zrc_qch_xw-d46e200867","topics":[]},{"title":"Using the Cli Command","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_kpw_mdt_qt","attributes": {"data-id":"concept_kpw_mdt_qt",},"menu": {"hasChildren":true,},"tocID":"concept_kpw_mdt_qt-d46e201107","next":"concept_kpw_mdt_qt-d46e201107",},{"title":"Help Command","shortdesc":"\n               <p class=\"shortdesc\">Use the help command to view additional information for the specified         command.</p>\n            ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_okz_qdq_yt","attributes": {"data-id":"concept_okz_qdq_yt",},"menu": {"hasChildren":false,},"tocID":"concept_okz_qdq_yt-d46e201873","topics":[]},{"title":"Manager Command","shortdesc":"\n               <p class=\"shortdesc\">The <code class=\"ph codeph\">manager</code> command provides subcommands to start and stop a pipeline,         view the status of all pipelines, and reset the origin\n                  for a pipeline. It can also be used         to get the last-saved offset and to update the last-saved offset for a pipeline.\n               </p>\n            ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_msh_k2q_yt","attributes": {"data-id":"concept_msh_k2q_yt",},"menu": {"hasChildren":false,},"tocID":"concept_msh_k2q_yt-d46e202150","topics":[]},{"title":"Store Command","shortdesc":"\n               <p class=\"shortdesc\">The <code class=\"ph codeph\">store</code> command provides subcommands to view a list of all pipelines         and to import a pipeline. \n               </p>\n            ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_xc2_vyw_yt","attributes": {"data-id":"concept_xc2_vyw_yt",},"menu": {"hasChildren":false,},"tocID":"concept_xc2_vyw_yt-d46e202441","topics":[]},{"title":"System Command","shortdesc":"\n               <p class=\"shortdesc\">The <code class=\"ph codeph\">system</code> command provides subcommands to register and unregister the             <span class=\"ph\">Data Collector</span>         with <span class=\"ph\">Control Hub</span>. \n               </p>\n            ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_bdt_5ky_fz","attributes": {"data-id":"concept_bdt_5ky_fz",},"menu": {"hasChildren":false,},"tocID":"concept_bdt_5ky_fz-d46e202742","topics":[]}]});